- имаћете могућност да обрежете слику након што је отпремите за савршено уклапање.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Кликните на "Додај нову слику" да бисте отпремили датотеку слике са вашег рачунара. Ваша тема најбоље функционише са сликом која има величину заглавља од %s пиксела - имаћете могућност да обрежете слику након што је отпремите за савршено уклапање.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Кликните на "Додај нову слику" да бисте отпремили датотеку слике са вашег рачунара. Ваша тема најбоље функционише са сликом која одговара величини вашег видео записа - имаћете могућност да обрежете слику након што је отпремите за савршено уклапање.','%1$s-%2$s'=>'%1$s-%2$s','Create New Menu'=>'Направи нови изборник','Date'=>'Датум','Day'=>'Дан','Hour'=>'Час','Minute'=>'Минут','Month'=>'Месец','Name for the Visual editor tabVisual'=>'Видљиво','New Menu'=>'Нови изборник','Time'=>'Време','Usage of user levels is deprecated. Use capabilities instead.'=>'Коришћење корисничких нивоа је застарело. Користите способности уместо тога.','The theme defines itself as its parent theme. Please check the %s header.'=>'Тема одређује себе као своју родитељску тему. Молимо вас да проверите заглавље %s.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Уколико ваша тема има просторе за виџете, тамо такође можете додати изборнике. Посетите <a href="%s">таблу виџета</a> и додајте &#132;виџет Изборник кретања&#147; да бисте приказали изборник у бочној траци или подножју.','Meridian'=>'Меридијан','Add your own CSS code here to customize the appearance and layout of your site.'=>'Овде додајте свој CSS код да бисте прилагодили изглед и распоред свог веб места.','CSS code'=>'CSS код','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Можете одабрати шта је приказано на почетној страници свог  веб места. То могу бити чланци у обрнутом хронолошком редоследу (класични блог) или учвршћена/непокретна страна. Да бисте поставили непокретну почетну страницу, прво морате да направите две стране. Једна ће постати почетна страница а друга ће бити где се ваши чланци приказују.','Your homepage displays'=>'Ваша почетна страница приказује','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Корисници читача екрана: када сте у режиму образаца, можда ћете морати да притиснете Esc дугме два пута.','Your theme can display menus in %s location.'=>'Ваша тема може да прикаже изборнике на %s месту.' . "\0" . 'Ваша тема може да прикаже изборнике на %s местa.' . "\0" . 'Ваша тема може да прикаже изборнике на %s местa.','Your theme can display menus in one location.'=>'Ваша тема може да прикаже изборнике на једном месту.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Уколико ваша тема има више изборника, давање јасних имена ће вам помоћи у њиховом управљању.','In the editing area, the Tab key enters a tab character.'=>'У простору за уређивање, дугме Tab уноси tab знак.','To move away from this area, press the Esc key followed by the Tab key.'=>'Да бисте се померили са овог простора, притисните думге Esc па Tab.','When using a keyboard to navigate:'=>'Када користите тастатуру за кретање:','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Поље за уређивање аутоматски истиче синтаксу кода. Ово можете онемогућити на свом <a href="%1$s" %2$s>корисничком профилу %3$s</a> да бисте радили у текстуалном режиму.','Homepage Settings'=>'Подешавања почетне странице','Changes have already been trashed.'=>'Измене су већ на отпаду.','Changes trashed successfully.'=>'Измене су успешно бачене на отпад.','Copied'=>'Умножено','Installed themes'=>'Постављене теме','Publish Settings'=>'Подешавања објављивања','Unable to save due to %s invalid setting.'=>'Снимање није могуће због %s неправилног подешавања.' . "\0" . 'Снимање није могуће због %s неправилна подешавања.' . "\0" . 'Снимање није могуће због %s неправилних подешавања.','Unable to trash changes.'=>'Није могуће бацити измене на отпад.','WordPress.org themes'=>'WordPress.org теме','No changes saved yet, so there is nothing to trash.'=>'Још увек нема сачуваних промена тако да нема ништа за пребацивање на отпад.','Preview Link'=>'Веза предпрегледа','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Видите како би промене изгледале уживо на вашем веб месту и поделите предпреглед са људима који не могу да приступе прилагођивачу.','Share Preview Link'=>'Дељење веза предпрегледа','You must supply a future date to schedule.'=>'Морате навести датум у будућности да бисте заказали.','There was an authentication problem. Please reload and try again.'=>'Догодио се проблем са аутентификацијом. Молимо вас да поново учитате и покушате поново.','Edit User'=>'Уређивање корисника','View User'=>'Види корисника','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Претходни скуп промена је већ објављен. Молимо вас да поново покушате са чувањем тренутног скупа промена.','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Овај виџет можда је садржао код који би боље радио у виџету &#132;Прилагођени HTML&#147;. Уколико још нисте, шта мислите о испробавању тог виџета?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Изгледа да сте управо налепили HTML у језичак &#132;Видљиво&#147; текстуалног виџета. Можда желите да налепите свој код у језичак &#132;Текст&#147; уместо тога. На крају, можете и да пробате нови виџет &#132;Прилагођени HTML&#147;.','Did you just paste HTML?'=>'Да ли сте налепили HTML?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Да ли знате да постоји виџет &#132;Прилагођени HTML&#147;? Можете га пронаћи претрагом списка доступних виџета на овом екрану. Пробајте га да бисте додали прилагођени код свом веб месту!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Да ли знате да постоји виџет &#132;Прилагођени HTML&#147;? Можете га пронаћи притиском на дугме &#132;<a class="add-widget" href="#">Додај виџет</a>&#147; и тражећи &#132;HTML&#147;. Пробајте га да бисте додали прилагођени код свом веб месту!','Arbitrary text.'=>'Произвољни текст.','New Custom HTML Widget'=>'Нови Прилагођени HTML виџет','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'Овај виџет може да садржи код који би боље радио у виџету &#132;Прилагођени HTML&#147;. Шта мислите да пробате тај виџет?','Arbitrary HTML code.'=>'Произвољни HTML код.','Custom HTML'=>'Прилагођени HTML','Some HTML tags are not permitted, including:'=>'Неке HTML ознаке нису дозвољене, укључујући:','%s item'=>'%s ставка' . "\0" . '%s ставке' . "\0" . '%s ставки','Show tag counts'=>'Покажи број ознака','label for button in the media widgetAdd Media'=>'Додај садржај','label for button in the image widgetAdd Image'=>'Додај слику','label for button in the video widgetAdd Video'=>'Додај видео запис','label for button in the audio widgetAdd Audio'=>'Додај звучни запис','(no author)'=>'(нема аутора)','Add to Widget'=>'Додај у виџет','Attachment post ID'=>'ID чланка прилога','Greetings Network Administrator!'=>'Поздрав, управниче мреже!','Looks like this is not the correct kind of file. Please link to an appropriate file instead.'=>'Изгледа да ово није исправна врста датотеке. Молимо вас да уместо тога повежете ка исправној датотеци.','No media selected'=>'Нема одабраног садржаја','The network currently allows both site and user registrations.'=>'Мрежа тренутно дозвољава регистрацију веб места и корисника.','The network currently allows site registrations.'=>'Мрежа тренутно дозвољава регистрацију веб места.','The network currently allows user registrations.'=>'Мрежа тренутно дозвољава регистрацију корисника.','The network currently disallows registrations.'=>'Мрежа тренутно не дозвољава регистрације.','Title for the widget'=>'Наслов виџета','To change or disable registration go to your <a href="%s">Options page</a>.'=>'Да бисте променили или искључили регистрације, идите на своју <a href="%s">страницу могућности</a>.','URL to the %s video source file'=>'URL ка %s датотеци видео извора','URL to the media file'=>'URL ка датотеци садржаја','Video Widget'=>'Виџет видео записа','A media item.'=>'Ставка садржаја.','Media Widget'=>'Виџет садржаја','Media Widget (%d)'=>'Виџет садржаја (%d)' . "\0" . 'Виџет садржаја (%d)' . "\0" . 'Виџет садржаја (%d)','Video Widget (%d)'=>'Виџет видео записа (%d)'